import { Box, Paper, Typography } from "@mui/material";


export default function AboutPage() {

    return (
        <Box sx={{display:'flex', 
        flexDirection:'column', 
        justifyContent:'center',
        alignItems:'center',
        marginTop:2}} component={Paper}>
            <Typography  variant="h4">This is about page</Typography>
        </Box>

    )
}
